import * as React from 'react';
import { LineChart, Legend } from '@mui/x-charts';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

const uData = [4000, 3000, 2000, 2780, 1890, 2390, 3490];
const pData = [2400, 1398, 9800, 3908, 4800, 3800, 4300];
const xLabels = [
  'Mon',
  'Tue',
  'Wed',
  'Thu',
  'Fri',
  'Sat',
  'Sun',
];

const products = [
  { name: 'Frozen yoghurt', calories: 159, fat: 6, carbs: 24, protein: 4 },
  { name: 'Ice cream sandwich', calories: 237, fat: 9, carbs: 37, protein: 4.3 },
  { name: 'Eclair', calories: 262, fat: 16, carbs: 24, protein: 6 },
  { name: 'Cupcake', calories: 305, fat: 3.7, carbs: 67, protein: 4.3 },
  { name: 'Gingerbread', calories: 356, fat: 16, carbs: 49, protein: 3.9 },
];

export default function Dashboard() {
  return (
    <Container style={{ padding: '20px', maxWidth: '100%' }}>
      <Typography variant="h4" gutterBottom>
        Dashboard
      </Typography>
      <Typography variant="h6" gutterBottom>
        Saved reports
      </Typography>
      <Typography variant="h6" gutterBottom>
        Orders
      </Typography>

      <Box sx={{ flexGrow: 1, marginBottom: 4 }}>
        <LineChart
          width="100%"
          height={400}
          grid={{ vertical: false, horizontal: true }}
          xAxis={[{ scaleType: 'point', data: xLabels }]}
          series={[
            { data: pData, label: 'Product A' },
            { data: uData, label: 'Product B' },
          ]}
          margin={{ bottom: 70, top: 10 }}
        />
        <Legend
          position="bottom"
          series={[
            { data: pData, label: 'Product A' },
            { data: uData, label: 'Product B' },
          ]}
        />
      </Box>

      <Typography variant="h6" gutterBottom>
        Products
      </Typography>

      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Dessert (100g serving)</TableCell>
              <TableCell align="right">Calories</TableCell>
              <TableCell align="right">Fat (g)</TableCell>
              <TableCell align="right">Carbs (g)</TableCell>
              <TableCell align="right">Protein (g)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {products.map((product) => (
              <TableRow key={product.name}>
                <TableCell component="th" scope="row">
                  {product.name}
                </TableCell>
                <TableCell align="right">{product.calories}</TableCell>
                <TableCell align="right">{product.fat}</TableCell>
                <TableCell align="right">{product.carbs}</TableCell>
                <TableCell align="right">{product.protein}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
}
